namespace RonSijm.FluidHumidifier.Factories.Lambda;

public class FunctionFactory(string resourceName = null, Action<Humidifier.Lambda.Function> factoryAction = null) : ResourceFactory<Humidifier.Lambda.Function>(resourceName)
{

    internal List<InnerFunctionFileSystemConfigFactory> FileSystemConfigsFactories { get; set; } = [];

    internal InnerFunctionTracingConfigFactory TracingConfigFactory { get; set; }

    internal InnerFunctionVpcConfigFactory VpcConfigFactory { get; set; }

    internal InnerFunctionRuntimeManagementConfigFactory RuntimeManagementConfigFactory { get; set; }

    internal InnerFunctionSnapStartFactory SnapStartFactory { get; set; }

    internal InnerFunctionImageConfigFactory ImageConfigFactory { get; set; }

    internal InnerFunctionDeadLetterConfigFactory DeadLetterConfigFactory { get; set; }

    internal InnerFunctionCodeFactory CodeFactory { get; set; }

    internal InnerFunctionLoggingConfigFactory LoggingConfigFactory { get; set; }

    internal InnerFunctionEnvironmentFactory EnvironmentFactory { get; set; }

    internal InnerFunctionEphemeralStorageFactory EphemeralStorageFactory { get; set; }

    protected override Humidifier.Lambda.Function Create()
    {
        var functionResult = CreateFunction();
        factoryAction?.Invoke(functionResult);

        return functionResult;
    }

    private Humidifier.Lambda.Function CreateFunction()
    {
        var functionResult = new Humidifier.Lambda.Function
        {
            GivenName = InputResourceName,
        };

        return functionResult;
    }
    public override void CreateChildren(Humidifier.Lambda.Function result)
    {
        base.CreateChildren(result);

        result.FileSystemConfigs = FileSystemConfigsFactories.Any() ? FileSystemConfigsFactories.Select(x => x.Build()).ToList() : null;
        result.TracingConfig ??= TracingConfigFactory?.Build();
        result.VpcConfig ??= VpcConfigFactory?.Build();
        result.RuntimeManagementConfig ??= RuntimeManagementConfigFactory?.Build();
        result.SnapStart ??= SnapStartFactory?.Build();
        result.ImageConfig ??= ImageConfigFactory?.Build();
        result.DeadLetterConfig ??= DeadLetterConfigFactory?.Build();
        result.Code ??= CodeFactory?.Build();
        result.LoggingConfig ??= LoggingConfigFactory?.Build();
        result.Environment ??= EnvironmentFactory?.Build();
        result.EphemeralStorage ??= EphemeralStorageFactory?.Build();
    }

} // End Of Class

